import React from 'react'
import Contactusimg from './images/banner7imgd.png'
import './contactus.css';
import {FaFacebookF,FaWhatsapp,FaInstagram,FaTwitter, FaStaylinked } from 'react-icons/fa';


function contactus() {



function Submit(){

let name = document.getElementById("name").value
let email = document.getElementById("email").value
let phone = document.getElementById("number").value
// let adress = document.getElementById("adress").value
// let place= document.getElementById("place").value


if (name ==="") {
  document.getElementById("p1").innerHTML="enter a name"
  document.getElementById("p1").style.color="red"
  document.getElementById("name").style.border="2px solid red"
  
}else{
  document.getElementById("p1").innerHTML=""
  document.getElementById("name").style.border=""
}
if (email ==="") {
  document.getElementById("p2").innerHTML="enter a name"
  document.getElementById("p2").style.color="red"
  document.getElementById("email").style.border="2px solid red"
} else {
  document.getElementById("p2").innerHTML=""
  document.getElementById("email").style.border=""
}
if (phone ==="") {
  document.getElementById("p3").innerHTML="enter a name"
  document.getElementById("p3").style.color="red"
  document.getElementById("number").style.border="2px solid red"
} else {
  document.getElementById("p3").innerHTML=""
  document.getElementById("number").style.border=""
}
}


  return (
    <div className='maindiv'>
       <div className='inputdata'>
        
        <input  type='text'placeholder='Name' id='name' ></input>
        <p id='p1'></p>
        <input type='email'placeholder='@Email'id='email' ></input>
        <p id="p2"> </p>
        <input type='number'placeholder='Phone number' id='number' ></input>
        <p id='p3'> </p>
        <input type='text'placeholder='Address'id="adress"  ></input>
        <p id='p4'> </p>
        <input type='text'placeholder='Place' id='plce' ></input>
        <p id='p5'></p>  
      
        <button onClick={Submit}> Submit</button>
        </div>
      <div className='contactusimg'>
        <img src={ Contactusimg} className='imgcontact' alt=''></img>
        <div className='c-text'>
         <h4 className='icons' ><FaFacebookF className='fa' />Facebook</h4> 
         <h4 className='icons' >< FaWhatsapp className='fa'/>Whatsapp</h4> 
         <h4 className='icons'>< FaInstagram className='fa'/>Instagram</h4>
         <h4 className='icons'>< FaTwitter className='fa'/>Twitter</h4>
         
   
        
         
         
   
         
        </div>
      </div>
     

    
    </div>
  
  )
}


export default contactus
